import sqlite3

# Connect to the database (create it if not exists)
conn = sqlite3.connect('products.db')

# Create a cursor object to execute SQL commands
cursor = conn.cursor()

# Create the products table
cursor.execute('''CREATE TABLE IF NOT EXISTS products (
                    id INTEGER PRIMARY KEY,
                    name TEXT,
                    price REAL,
                    image_url TEXT,
                    categories TEXT
                )''')

# Sample data to populate the table
sample_data = [
    ("Hisense musice sounbar", 1.99, "data:image/png;base64,", "Music"),
    ("Canon", 0.99, "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQq0A1LLYTiQK3Sd_FT41tPSkbsISdzjnaTDg&usqp=CAU", "Camera"),
    ("Macbook M1", 2.49, "data:image/jpeg;base64,", "Laptops"),
    ("hisense Tv", 3.99, "data:image/jpeg;base64,","TV"),
    ("Hp elitebook 4390", 4.49, "data:image/jpeg;base64,","Laptops"),
]

# Insert sample data into the table
cursor.executemany('''INSERT INTO products (name, price, image_url,categories)
                        VALUES (?, ?, ?,?)''', sample_data)

# Commit changes and close the connection
conn.commit()
conn.close()

print("Database and table created successfully.")
